import React, { useState } from 'react';

const LoginPageChimiste = () => {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log("Chimiste logged in");
  };

  return (
    <div className="login-container">
      <h2>Chimiste Login</h2>
      <p>As a Chimiste, you can submit molecular structures and receive predictions about affinity and molecular optimization.</p>
      
      <form onSubmit={handleSubmit}>
        <label htmlFor="email">Email:</label>
        <input 
          type="email" 
          id="email" 
          value={email} 
          onChange={(e) => setEmail(e.target.value)} 
          required 
        />
        
        <label htmlFor="password">Password:</label>
        <input 
          type="password" 
          id="password" 
          value={password} 
          onChange={(e) => setPassword(e.target.value)} 
          required 
        />
        
        <button type="submit">Login</button>
      </form>

      <div>
        <h3>Chimiste-Specific Information:</h3>
        <p>As a Chimiste, you will be able to:</p>
        <ul>
          <li>Submit molecular structures for analysis</li>
          <li>View predictions on molecular affinity</li>
          <li>Get optimization suggestions for your molecules</li>
        </ul>
        <p>Please ensure that the molecular structure is correctly formatted to get accurate predictions.</p>
      </div>
    </div>
  );
};

export default LoginPageChimiste;
